Victory At Sea

War Documentary hosted by Leonard Graves, published by NBC in 1954 - English narration


Information
------------------------------

Victory At Sea
The 26 episodes were culled from over 13,000 hours of footage shot by the U.S., British, German and Japanese navies during World War II. Narrated by Leonard Graves and set to a score by Richard Rodgers, this program offered a remarkable look at the realities of naval warfare and the extraordinary challenges faced by the Allies. From U-boat &quot;wolf packs&quot; to the epic battles at Iwo Jima and Okinawa, every major naval engagement of World War II is captured in some of the most riveting combat footage ever shot.




10)  Beneath the Southern Cross 
The South Atlantic becomes a front in the overall Battle of the Atlantic, from the pursuit of the German ship Graf Spee to the battle between HMS Devonshire and the German raider Atlantis. The Allies, meanwhile, nurture their relations with South America and gain a vital base in Ascension Island. Despite strong sympathy for the Nazis, the South American nations rally to the Allies' cause, securing vital bases, forces and resources.



